import React, { useState } from "react";

function Element({apiDataArray})
{
    const [apiArray,setApiArray]=useState(apiDataArray);
    return(
        <>
        {apiArray.map((data)=>
        {
            return(<>
            <h6>{data.id}</h6>
            <h2>{data.title}</h2>
            <h5>{data.price}</h5>
            <h4>{data.category}</h4>
            <img src={data.image} alt='img'></img>
            </>)
        })}

        </>
    )
}
export default Element;
